import React from "react";
import { NavLink } from "react-router-dom";
import web from "./images/ujjwal.jpg"
import Component from "./Component";

function Home() {
  return (
    <>
   <Component
    text="Welcome To Home Page "
    strongContent={<strong className="brand-name">Ujjwal Varshney</strong>}
    text2="This is Homepage and this is a dummy project also my first React Website. To know more about me click below"
    imgsrc={web}
    visit="/about"
    btname="About Me"
   />
    </>
  );
}

export default Home;
